const tailwindCssUrl =
  "https://cdn.jsdelivr.net/npm/tailwindcss@2.2/dist/tailwind.min.css";

State.init({
  theme: null,
});

const tailwindCss = fetch(tailwindCssUrl).body;

if (!tailwindCss) return "Can't load CSS 😔.";

if (!state.theme) {
  State.update({
    theme: styled.div`
    ${tailwindCss}`,
  });
}

const Theme = state.theme;
const card = (
  <div class="relative">
    <div class="bg-white w-20 h-20 border-2 border-black text-black absolute z-1 top-4 left-4">
      Hello
    </div>
    <div class="bg-black w-20 h-20 " />
  </div>
);

return <Theme>{card}</Theme>;
